import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';
import { useState } from 'react';

const position = [35.6073, -97.6397]; // Example: 4255 Northwest 156th Street, United States

const Map = ({location}) => {

    const [postiton,setPosition] =useState(null);

  const markerIcon = new L.Icon({
    iconUrl: "https://cdn-icons-png.flaticon.com/512/684/684908.png",
    iconSize: [35, 35],
  });

  return (
    <MapContainer center={position} zoom={13} style={{ height: "400px", width: "100%",borderRadius:"10px" }}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="https://www.openstreetmap.org/">OpenStreetMap</a> contributors'
      />
      <Marker position={position} icon={markerIcon}>
        <Popup>4255 Northwest 156th Street, United States</Popup>
      </Marker>
    </MapContainer>
  );
};

export default Map;
